        textContent: [
          "\u0412 \u0441\u043B\u0443\u0447\u0430\u0435 \u043F\u0440\u0438\u0437\u043D\u0430\u043D\u0438\u044F \u0443\u0431\u044B\u0442\u043A\u0430 \u043E\u0442 \u043E\u0431\u0435\u0441\u0446\u0435\u043D\u0435\u043D\u0438\u044F \u0431\u0443\u0434\u0443\u0449\u0438\u0435 \u0440\u0430\u0441\u0445\u043E\u0434\u044B \u043D\u0430 \u0430\u043C\u043E\u0440\u0442\u0438\u0437\u0430\u0446\u0438\u044E \u043A\u043E\u0440\u0440\u0435\u043A\u0442\u0438\u0440\u0443\u044E\u0442\u0441\u044F \u0434\u043B\u044F \u0441\u0438\u0441\u0442\u0435\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u0440\u0430\u0441\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u0438\u044F \u043F\u0435\u0440\u0435\u0441\u043C\u043E\u0442\u0440\u0435\u043D\u043D\u043E\u0439 \u0431\u0430\u043B\u0430\u043D\u0441\u043E\u0432\u043E\u0439 \u0441\u0442\u043E\u0438\u043C\u043E\u0441\u0442\u0438 \u0432 \u0442\u0435\u0447\u0435\u043D\u0438\u0435 \u043E\u0441\u0442\u0430\u044E\u0449\u0435\u0433\u043E\u0441\u044F \u0441\u0440\u043E\u043A\u0430 \u043F\u043E\u043B\u0435\u0437\u043D\u043E\u0439 \u0441\u043B\u0443\u0436\u0431\u044B \u0430\u043A\u0442\u0438\u0432\u0430.",
          "\u0423\u0431\u044B\u0442\u043E\u043A \u043E\u0442 \u043E\u0431\u0435\u0441\u0446\u0435\u043D\u0435\u043D\u0438\u044F \u0430\u043A\u0442\u0438\u0432\u0430, \u0443\u0447\u0442\u0435\u043D\u043D\u043E\u0433\u043E \u043F\u043E \u043F\u0435\u0440\u0432\u043E\u043D\u0430\u0447\u0430\u043B\u044C\u043D\u043E\u0439 \u0441\u0442\u043E\u0438\u043C\u043E\u0441\u0442\u0438, \u043E\u0442\u0440\u0430\u0436\u0430\u0435\u0442\u0441\u044F \u0432 \u043E\u0442\u0447\u0435\u0442\u0435 \u043E \u043F\u0440\u0438\u0431\u044B\u043B\u044F\u0445 \u0438 \u0443\u0431\u044B\u0442\u043A\u0430\u0445, \u0430 \u043F\u0435\u0440\u0435\u043E\u0446\u0435\u043D\u0435\u043D\u043D\u043E\u0433\u043E \u0430\u043A\u0442\u0438\u0432\u0430 - \u043F\u0440\u0438\u0437\u043D\u0430\u0435\u0442\u0441\u044F \u043A\u0430\u043A \u0443\u043C\u0435\u043D\u044C\u0448\u0435\u043D\u0438\u0435 \u0440\u0435\u0437\u0435\u0440\u0432\u0430 \u043F\u0435\u0440\u0435\u043E\u0446\u0435\u043D\u043A\u0438 \u0430\u043A\u0442\u0438\u0432\u0430. \u0415\u0441\u043B\u0438 \u0443\u0431\u044B\u0442\u043E\u043A \u043E\u0442 \u043E\u0431\u0435\u0441\u0446\u0435\u043D\u0435\u043D\u0438\u044F \u043F\u0440\u0435\u0432\u044B\u0448\u0430\u0435\u0442 \u0441\u0443\u043C\u043C\u0443, \u0438\u043C\u0435\u044E\u0449\u0443\u044E\u0441\u044F \u043D\u0430 \u0441\u0447\u0435\u0442\u0435 \u0440\u0435\u0437\u0435\u0440\u0432\u0430 \u043F\u0435\u0440\u0435\u043E\u0446\u0435\u043D\u043A\u0438, \u0442\u043E \u0441\u0443\u043C\u043C\u0430 \u043F\u0440\u0435\u0432\u044B\u0448\u0435\u043D\u0438\u044F \u043E\u0442\u0440\u0430\u0436\u0430\u0435\u0442\u0441\u044F \u0432 \u043E\u0442\u0447\u0435\u0442\u0435 \u043E \u043F\u0440\u0438\u0431\u044B\u043B\u044F\u0445 \u0438 \u0443\u0431\u044B\u0442\u043A\u0430\u0445.",
          "\u041F\u0440\u0438\u043C\u0435\u043D\u0435\u043D\u0438\u0435 \u041C\u0421\u0424\u041E 36 \xAB\u041E\u0431\u0435\u0441\u0446\u0435\u043D\u0435\u043D\u0438\u0435 \u0430\u043A\u0442\u0438\u0432\u043E\u0432\xBB \u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u043E\u0431\u044F\u0437\u0430\u0442\u0435\u043B\u044C\u043D\u044B\u043C \u0434\u043B\u044F \u043A\u043E\u043C\u043F\u0430\u043D\u0438\u0439, \u0432\u0435\u0434\u0443\u0449\u0438\u0445 \u0444\u0438\u043D\u0430\u043D\u0441\u043E\u0432\u0443\u044E \u043E\u0442\u0447\u0435\u0442\u043D\u043E\u0441\u0442\u044C \u043F\u043E \u043C\u0435\u0436\u0434\u0443\u043D\u0430\u0440\u043E\u0434\u043D\u044B\u043C \u0441\u0442\u0430\u043D\u0434\u0430\u0440\u0442\u0430\u043C. \u041F\u0440\u0438\u043C\u0435\u043D\u0435\u043D\u0438\u0435 \u0434\u0430\u043D\u043D\u043E\u0433\u043E \u0441\u0442\u0430\u043D\u0434\u0430\u0440\u0442\u0430 \u043F\u043E\u0437\u0432\u043E\u043B\u044F\u0435\u0442 \u0442\u0430\u043A\u0436\u0435 \u043F\u0440\u0438\u043D\u0438\u043C\u0430\u0442\u044C \u0432\u0437\u0432\u0435\u0448\u0435\u043D\u043D\u044B\u0435 \u0438 \u0430\u0434\u0435\u043A\u0432\u0430\u0442\u043D\u044B\u0435 \u0440\u0435\u0448\u0435\u043D\u0438\u044F \u043E \u0434\u0430\u043B\u044C\u043D\u0435\u0439\u0448\u0435\u043C \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u0438\u0438 \u0438\u043B\u0438 \u0440\u0435\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u0438 \u043D\u0435\u044D\u0444\u0444\u0435\u043A\u0442\u0438\u0432\u043D\u044B\u0445 \u0430\u043A\u0442\u0438\u0432\u043E\u0432."
        ],
        enums: [],
