          "\u0430\u043D\u0430\u043B\u0438\u0437 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0443\u044E\u0449\u0435\u0439 \u043F\u0440\u0430\u0432\u043E\u0432\u043E\u0439 \u0438 \u0438\u0441\u0445\u043E\u0434\u043D\u043E-\u0440\u0430\u0437\u0440\u0435\u0448\u0438\u0442\u0435\u043B\u044C\u043D\u043E\u0439 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u0430\u0446\u0438\u0438 \u043D\u0430 \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u043E",
          "\u0430\u043D\u0430\u043B\u0438\u0437 \u0438\u043C\u0435\u044E\u0449\u0435\u0439\u0441\u044F \u043F\u0440\u043E\u0435\u043A\u0442\u043D\u043E-\u0441\u043C\u0435\u0442\u043D\u043E\u0439, \u0434\u043E\u0433\u043E\u0432\u043E\u0440\u043D\u043E\u0439, \u0444\u0438\u043D\u0430\u043D\u0441\u043E\u0432\u043E\u0439, \u0442\u0435\u0445\u043D\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u0438 \u0438\u0441\u043F\u043E\u043B\u043D\u0438\u0442\u0435\u043B\u044C\u043D\u043E\u0439 \u0434\u043E\u043A\u0443\u043C\u0435\u043D\u0442\u0430\u0446\u0438\u0438 \u043F\u043E \u0441\u0442\u0440\u043E\u0438\u0442\u0435\u043B\u044C\u043D\u043E\u043C\u0443 \u043F\u0440\u043E\u0435\u043A\u0442\u0443",
          "\u0430\u043D\u0430\u043B\u0438\u0437 \u0438\u043D\u0436\u0435\u043D\u0435\u0440\u043D\u043E\u0433\u043E \u043E\u0431\u0435\u0441\u043F\u0435\u0447\u0435\u043D\u0438\u044F \u043E\u0431\u044A\u0435\u043A\u0442\u0430",
